// Dashboard.js
import React, { useState } from 'react';
import '../styles/Dashboard.css';
import '../styles/signin.css';

const Dashboard = () => {
  const [activeMenuItem, setActiveMenuItem] = useState('dashboard');

  const handleMenuClick = (menuItem) => {
    setActiveMenuItem(menuItem);
    // Add logic to handle the click event for the selected menu item (e.g., navigate to the corresponding page).
  };

  return (
    <div className="Dashboard">
      <div className="VerticalMenu">
        <div
          className={`MenuItem ${activeMenuItem === 'dashboard' ? 'Active' : ''}`}
          onClick={() => handleMenuClick('dashboard')}
        >
          Dashboard
        </div>
        <div
          className={`MenuItem ${activeMenuItem === 'analytics' ? 'Active' : ''}`}
          onClick={() => handleMenuClick('analytics')}
        >
          Analytics
        </div>
        <div
          className={`MenuItem ${activeMenuItem === 'reports' ? 'Active' : ''}`}
          onClick={() => handleMenuClick('reports')}
        >
          Reports
        </div>
        {/* Add more menu items as needed */}
      </div>

      {/* Your dashboard content goes here */}
      <div className="Content">
        {/* Content for the selected menu item will be rendered here */}
        {activeMenuItem === 'dashboard' && <h1>Dashboard Content</h1>}
        {activeMenuItem === 'analytics' && <h1>Analytics Content</h1>}
        {activeMenuItem === 'reports' && <h1>Reports Content</h1>}
        {/* Add more content sections for other menu items */}
      </div>
    </div>
  );
};

export default Dashboard;
